import React from 'react';
// import { IconName } from "react-icons/ci";
import './MyHeader.css'
import MyHeader from './MyHeader.tsx';

class Accueil extends React.Component{
    render() {
        return (
            <>
            <MyHeader></MyHeader>
            <div className="banniere">
                <div className="filtre">
                <h1>Véhicules d'Exception Découvrez Notre Sélection</h1>
                <p>Bienvenue sur Buy Car, 
                    votre destination ultime pour trouver la voiture de vos rêves ! 
                    Que vous soyez à la recherche d'une voiture d'occasion fiable,
                     d'une voiture neuve dernier cri ou simplement à la recherche d'inspiration,
                     vous êtes au bon endroit. </p>

                </div>
            </div>
            <p>Coucou</p>
            </>
        );
    }
}

export default Accueil;
